                                      timeInSecForIosWeb: 3,
                                      backgroundColor: Colors.red,
                                      textColor: Colors.white,
                                      fontSize: 16.0);
                                } else {
                                  senddata();
                                
                                  tabController?.animateTo(2);
                                }
                              }, // Switch tabs
                              child: Text(
                                S.of(context).Next,
                                style: TextController.btnText,
                              ),
                            ),
                          ),
                ],
              ),
            ),
          ],
        ),
      ),

      //

      ///
    );
  }

  void openFile(PlatformFile file) {
    OpenFile.open(file.path);
  }
}
